import React, { useEffect, useState } from "react";
import Container from "@material-ui/core/Container";
import Card from "@material-ui/core/Card";
import Typography from "@material-ui/core/Typography";
import CardContent from "@material-ui/core/CardContent";
import CardMedia from "@material-ui/core/CardMedia";
import { makeStyles } from "@material-ui/core/styles";
import Grid from "@material-ui/core/Grid";
import assets_data from "./data/assets";

const useStyles = makeStyles({
  card: {
    maxWidth: 500,
    boxShadow: "0 5px 8px 0 rgba(0, 0, 0, 0.3)",
    backgroundColor: "#fafafa"
  },
  media: {
    height: 400
  }
});

function App() {
  /*
  const [data, setData] = useState([]);

  useEffect(() => {
    fetch(
      ""
    )
      .then((res) => res.json())
      .then((data) => setData(data.assets));
  }, [data]);
*/

  const classes = useStyles();

  return (
    <div>
      <Container>
        <Typography
          color="textPrimary"
          gutterBottom
          variant="h2"
          align="center"
        >
          My Collection
        </Typography>

        <Grid container spacing={10}>
          {assets_data.assets.map((character) => (
            <Grid item xs={12} sm={3} key={character.id}>
              <Card className={classes.card}>
                <CardMedia className={classes.media} image={character.image} />

                <CardContent>
                  <Typography color="primary" variant="subtitle1">
                    {character.name}
                  </Typography>

                  <Typography color="textSecondary" variant="subtitle2">
                    {"Owner: " + (character.owner ? character.owner : "-")}
                  </Typography>
                </CardContent>
              </Card>
            </Grid>
          ))}
        </Grid>
      </Container>
    </div>
  );
}

export default App;
